import {NavLink} from "react-router-dom";
import '../Elements/Button/button.scss'

// import {Link} from 'react-scroll'

const Menu = () => {

  return (
    <div className="o-row">
    <div className="o-col  t-site-header__menu">
      <div className="c-nav">
          <button className="c-nav__item">
            <a href="#start" className="c-nav__link"><NavLink exact to="/">Start</NavLink></a></button>
          <button className="c-nav__item"><a href="O co chodzi" className="c-nav__link">O co chodzi</a></button>
          <button className="c-nav__item">O nas</button>
          <button className="c-nav__item">Fundacje i  organizacje</button>
          <button className="c-nav__item">Kontakt</button>
      </div>
    </div>
    </div>
  )
}

export default Menu;
